INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (137, 'Drukarka zdjęć portable photo printer', 300.00, 'Portable Printer', 'Ximi', 'Mini drukarka Ximi idealnie sprawdzi się do wydrukowania Twoich zdjęć dzięki technologii ZINK, bez atramentu. W ten sposób drukowanie jest dziecinnie proste.');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (138, 'Aparat wielkoformatowy Proma', 1050.00, 'Proma 45', 'Gibel', 'Pierwszy składany aparat wielkoformatowy wydrukowany na drukarce 3D! Aparat nie waży dużo - zrobiony jest z PLA (Polilaktyd, otrzymywany ze skrobi) a więc idealne nada się dla studentów lub fotografów chcących zacząć przygodę z dużym formatem.');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (139, 'Canon PowerShot G7X Mark', 1170.00, 'G7X', 'Mark', 'Aparaty kompaktowe marki Canon wyposażone są we wszystkie najnowsze rozwiązania technologiczne, dzięki którym fotografowanie na co dzień i podczas podróży stanie się czystą przyjemnością. Bogaty wybór modeli sprawia, że z pewnością znajdziesz coś dla siebie - bez względu na to czy stawiasz pierwsze kroki w fotografii, potrzebujesz aparatu na wakacyjny wyjazd, czy poszukujesz bardziej zaawansowanego sprzętu w niewielkich rozmiarach.');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (140, 'Aparat cyfrowy Olymp OM-D', 2100.00, 'OM-D E-M1', 'Olympus', 'Linia aparatów OM-D łączy w sobie zaawansowane technologie i klasyczną stylistykę. To połączenie pozwala tworzyć wyjątkowe aparaty, którymi fotografowanie i filmowanie staje się czystą przyjemnością. Olympus OM-D E-M1 Mark III kontynuuje te tradycje, udostępniając przy tym stabilizację obrazu o imponującej wydajności wynoszącej aż 7,5 EV, procesor obrazu TruePic IX i niezwykle wydajny system AF. To aparat, który łącząc wyjątkowo kompaktową i mobilną konstrukcję, oferuje parametry mogące sprostać oczekiwaniom profesjonalistów.');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (141, 'Aparat sons Alpha a7 III body', 8700.00, 'D7500', 'Sons', 'Model D7500 rejestruje wyraźne zdjęcia o wysokiej rozdzielczości i płynnych przejściach tonalnych. Cechuje się ponadto bardzo dokładnym rozpoznawaniem obiektów i doskonałą jakością obrazu przy wysokiej czułości ISO. Jakość materiału wideo rejestrowanego w rozdzielczości 4K/UHD potrafi wprost oczarować. Zastosowany w tym aparacie system Picture Control ułatwia nadawanie własnego stylu twórczego rejestrowanym zdjęciom i filmom.');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (142, 'GOLDGAMER i9 10900 4,7GHz/ 32GB/ SSD', 6000.00, 'GOLDGAMER', 'QuickPC', 'Nowoczesna platforma z dziesięciordzeniowym ( 20 wątków )  procesorem INTEL i9 10900F, z pamięciami DDR4 i wydajną grafiką RTX 3060 Ti  8GB. Komputer stworzony dla wymagających graczy, bez problemu zagrasz w najnowsze i wymagające tytuły. Komputer nadaję się również do streamingu. Wersja limitowana w niesamowitej obudowie RAIDMAX F01, obudowa posiada otwierane okno z hartowanego szkła i podświetlenie ARGB');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (143, 'X240 |I5-4Gen|8GB|128SSD', 3300.50, 'X240', 'QuickPC', 'Komputer M83 posiada niektóre z najlepszych narzędzi zabezpieczających dostępnych na rynku, w tym funkcja blokowania portów USB w celu zapobiegania kradzieży danych i zagrożeniom bezpieczeństwa sieci wynikających z nieupoważnionego użycia urządzeń magazynujących. Trusted Platform Module (TPM) szyfruje dane i kluczowe informacje, takie jak hasła i certyfikaty cyfrowe.');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (144, 'Laptop do Gier Book A Ryz 5', 1400.00, 'Ryz 5', 'Book', 'MAIBENBEN zawsze opierał się na ekstremalnym doświadczeniu użytkownika, koncentruje się na produktach i usługach . Jest modną, opłacalną marką laptopów i jest kochany przez młodsze pokolenie na całym świecie.');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (145, 'DALL Latitu e6540 i7 16GB', 4000.00, 'Latitu', 'DALL', 'Laptopy klasy biznesowej o ponadprzeciętnych parametrach. Sprawdzą się wszędzie tam, gdzie wymagana jest duża przestrzeń robocza, estetyka i jakość wykonania.Idealnie nadaje się do zastosowań domowych (gry, programy, filmy, Internet) jak i profesjonalnych (projektowanie 3D, montaż filmów, obróbka graficzna).');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (146, 'FOTEL GAMINGOWY Obrotowy', 500.00, 'Gamming', 'Diablo', 'Krzesło, którego chciałby używać każdy prawdziwy gracz. A może bystra osoba pracująca w biurze, która ceni sobie wygodę i uwielbia adrenalinę oraz uczucie siedzenia na fotelu do gier.');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (147, 'ADAPTER Konwerter z HDMI do VGA ', 30.00, 'HDMI-VGA', 'Gembird', 'Pozwala na podłączenie monitora lub projektora ze złączem VGA do dowolnego urządzenia wyposażonego w złącze HDMI np. smartfona, tabletu, laptopa, komputera, konsoli, itp.');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (148, 'Play St 2 SLIM ', 200.00, 'SCPH-77003', 'PlaySt', 'Oferuje na sprzedaż konsole PlayStation 2 model SCPH - 39003, naturalnie jest ona sprawna w 100%.');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (149, 'Konsola Ps z BLU-RAY', 4500.00, 'CFI-1016a', 'Playstation', 'Ultraszybki dysk SSD zapewnia błyskawiczne czasy ładowania. Zainstalowane na konsoli PS5 gry będą ładować się w mgnieniu oka. Wykorzystując moc procesora niestandardowego, procesora graficznego i dysku SSD ze zintegrowanym We/Wy, stworzono nowe zasady tego, na co stać konsolę PlayStation. Co oznacza mniej czekania na loadingu!');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (150, 'KONSOLA BOX S 1TB', 2300.00, 'SDA-23LK', 'BOX', 'Podziwiaj najbardziej szczegółową grafikę w rozdzielczości 4K Ultra HD. Wysoki wskaźnik kontrastu pozwala bezbłędnie rozróżniać tekstury, dodając grze wizualną głębię.');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (151, 'Konsola Microsoft Xbox Series X', 3000.00, 'RRT-00010', 'BOX', 'Najnowsza konsola XBOX, wykorzystaj jej nowe i ogromne możliwości. Dodatkowo konsola posiada stylowy wygląd wpasowujący się w nowoczesne wnętrza.');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (152, 'GBoy Micro OXY', 600.00, '0XY', 'Game Boy', 'GBoy Micro, model OXY-001 wypuszczony przez Nintendo w roku 2005 jako zwieńczenie linii Game Boy. Oferowana wersja jest limitowaną edycją Famicom Edition 20th Anniversary wydaną na rynek japoński w roku 2005.');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (153, 'Nin N60 - konsola Box', 250.00, 'N64', 'Nin', 'Ten kartridż z grą pasuje i działa na wszystkich konsolach w wersji USA/EUR/Japan, bez regionu.');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (154, 'Spodenki Sportowe Męskie', 55.00, 'Men', 'Adas', 'Spodenki sportowe krótkie Parma renomowanego niemieckiego producenta najlepszego sprzętu sportowego firmy Ada zostały wykonane w 100% z poliestru o gęstym splocie.');
INSERT INTO PRODUCT (ID, NAME, PRICE, MODEL, BRAND, DESCRIPTION) VALUES (155, 'ZIMOWA KURTKA PARKA PIKOWANA BRAND', 100.00, 'ZK', 'BRAND', 'Żeby prawidłowo dobrać rozmiar dla siebie, najłatwiej jest zmierzyć swoją bluzę.');
